import React, { useState, useEffect } from 'react'
import styled from 'styled-components'
import axios from 'axios'
import {ToastsContainer, ToastsStore} from 'react-toasts';
import {  ToastContainer, toast } from 'react-toastify';
import { Card, CardBody, Heading } from 'uikit'
import { ethers } from 'ethers';
import Web3 from "web3";

// import Web3 from 'web3';


import tempABI from '../../../contracts/smartnodes.json';

const contractABI = tempABI.abi;
const contractAddress = '0xa5CD786fDA5802BeD0138E3e591eEB52712DD9Ee';

const StyledCard = styled(Card)`
  // min-height: 200px;
  box-shadow: 0 0 15px #f8981d;
  border: 1;
  background-color: #191b1f !important;
`

const RowBlock = styled.div`
  display: flex;
  flex-direction: row;
`

const RowBlockBetween = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
`

const StyledInput = styled.input`
  color: ${({ theme }) => theme.colors.textSubtle};
  font-size: 14px;
  margin-bottom: 22px;
  margin-top: 24px;
  padding: 8px;
  border-radius: 12px;
  background: #3a3a3c;
  text-align: center;
  width: 84%;
  border: 0px;
  :focus{
    border: 0px;
    outline: 0;
  }
`
const Actions = styled.div`
  margin-top: 24px;
`
const StyledCardBody = styled(CardBody)`
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;
`

const StyledButton = styled.button`
  align-items: center;
  border: 0;
  border-radius: 12px;
  padding: 12px;  
  cursor: pointer;
  display: inline-flex;
  width: 45%;
  margin-top: 20px;
  font-family: inherit;
  font-size: 14px;
  // font-weight: 600;
  justify-content: center;
  letter-spacing: 0.03em;  
  background-color: #212429;
  color: #faa21a;
  box-shadow: 0px 0px 10px rgba(224, 167, 60, 0.856);
  // line-height: 1;
  // outline: 0;
  transition: background-color 0.2s, opacity 0.2s;

  &:hover {
    opacity: 0.65;
  }

  &:active {
    opacity: 0.85;
    transform: translateY(1px);
    box-shadow: none;
  }
`;

const Label = styled.div<{ labelSize: string }>`
